 import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Importamos los estilos modulares

// Iconos sugeridos (puedes usar una librería como react-icons si quieres iconos Material Design)
const MenuIcon = () => <svg xmlns="http://www.w3.org/2000/svg" height="24" viewBox="0 0 24 24" width="24"><path d="M0 0h24v24H0z" fill="none"/><path d="M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z"/></svg>;
const UserIcon = () => <svg xmlns="http://www.w3.org/2000/svg" height="24" viewBox="0 0 24 24" width="24"><path d="M0 0h24v24H0z" fill="none"/><path d="M12 12c2.21 0 4-1.79 4-4s-1.79-4-4-4-4 1.79-4 4 1.79 4 4 4zm0 2c-2.67 0-8 1.34-8 4v2h16v-2c0-2.66-5.33-4-8-4z"/></svg>;

const Navbar = () => {
  // Estado para el cambio de estilo por scroll
  const [scrolled, setScrolled] = useState(false);
  // Estado para el menú móvil
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  // Función para manejar el evento de scroll
  const handleScroll = () => {
    const offset = window.scrollY;
    if (offset > 100) { // Se activa después de 100px de scroll
      setScrolled(true);
    } else {
      setScrolled(false);
    }
  };

  // Se suscribe al evento de scroll al montar el componente
  useEffect(() => {
    window.addEventListener('scroll', handleScroll);
    return () => {
      // Limpia el evento al desmontar el componente
      window.removeEventListener('scroll', handleScroll);
    };
  }, []); // El array vacío asegura que solo se ejecute al montar y desmontar

  // Definir la clase CSS basada en el scroll
  const navbarClasses = `navbar-container ${scrolled ? 'scrolled-capsule' : 'top-transparent'}`;

  // Función para cerrar el menú móvil al hacer clic en un enlace
  const closeMobileMenu = () => {
    if (isMobileMenuOpen) {
      setIsMobileMenuOpen(false);
    }
  };

  return (
    <header className={navbarClasses}>
      <div className="navbar-content">
        {/* Logo/Nombre de la Marca */}
        <Link to="/" className="navbar-logo" onClick={closeMobileMenu}>
          MASCOTAS
        </Link>

        {/* Links de Navegación (Solo Desktop) */}
        <nav className={`nav-links-desktop`}>
          <Link to="/" className="nav-item">Inicio</Link>
          <Link to="/servicios" className="nav-item">Servicios</Link>
          <Link to="/tienda" className="nav-item">Tienda</Link>
          <Link to="/contacto" className="nav-item">Contacto</Link>
        </nav>

        {/* Botones de Acción (Perfil/Menú) */}
        <div className="navbar-actions">
          {/* Ícono de Perfil/Login */}
          <Link to="/acceso" className="nav-icon" title="Iniciar Sesión" onClick={closeMobileMenu}>
            <UserIcon />
          </Link>

          {/* Botón de Menú Móvil (Solo Mobile) */}
          <button 
            className="mobile-menu-toggle" 
            onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
            aria-label="Toggle Navigation"
          >
            <MenuIcon />
          </button>
        </div>
      </div>

      {/* Menú Desplegable Móvil */}
      <nav className={`nav-links-mobile ${isMobileMenuOpen ? 'open' : ''}`}>
        <Link to="/" className="nav-item" onClick={closeMobileMenu}>Inicio</Link>
        <Link to="/servicios" className="nav-item" onClick={closeMobileMenu}>Servicios</Link>
        <Link to="/tienda" className="nav-item" onClick={closeMobileMenu}>Tienda</Link>
        <Link to="/contacto" className="nav-item" onClick={closeMobileMenu}>Contacto</Link>
        {/* El link de acceso ya está en el icono, pero se puede duplicar para claridad */}
        <Link to="/acceso" className="nav-item access-link" onClick={closeMobileMenu}>Iniciar Sesión</Link>
      </nav>
    </header>
  );
};

export default Navbar;
